export default function ContentSidebar() {
  return (
    <div id="ContentSidebar">
      <div id="hovet">
        <HomeIcon id="ContentSidebarIcon" />
        <p>Home</p>
      </div>
      <div id="hovet">
        <WhatshotIcon id="ContentSidebarIcon"/>
        <p>Short</p>
      </div>
